import React, { Component } from 'react';
import './Park.css';

class Park extends Component {
  render() {
    return (
	    <div className="parkBoard">
	      <div className="parkAvantar">
	        <img src={props.url} className="avantar" alt="logo"/>
	      </div>
	      <div className="parkInfo">
	        <h4>{props.name}</h4>
	      </div>
	    </div>
	  );
  }
}

export default Park;
